window.bookSummaryJSON = "<p>Jack London’s adventurous nature, intuitive feeling for animal life, and superb storytelling skills give his tales a striking vitality and force. Thrilling action and a sense of justice characterize the classic stories in this collection.</p> <p><i>The Call of the Wild</i></p> <p>A bold-spirited dog named Buck is stripped from his comfortable life on a California estate and thrust into the rugged terrain of the Klondike. There, he is made a sled dog and battles to become his team’s leader and the devoted servant of John Thornton, a man who shows him kindness amid the savage lawlessness of man and beast.</p> <p><i>White Fang</i></p> <p>In the desolate, frozen wilds of Northwest Canada, a lone wolf fights the heroic daily fight for life in the wild. But after he is captured and cruelly abused by men, he becomes a force of pure rage. Only one man sees inside the killer to his intelligence and nobility. But can his kindness touch White Fang?</p> <p>AudioFile Earphones Award. Audie Award finalist.</p>"; 
